INSERT INTO @jsonTable (SupportBankSettingID, InternalAuditID,  PaymentTypeGatewaySettingID, BankID)
SELECT JSON_VALUE(value, '$.SupportBankSettingID'), JSON_VALUE(value, '$.InternalAuditID'), JSON_VALUE(value, '$.PaymentTypeGatewaySettingID'), JSON_VALUE(value, '$.BankID')
FROM OPENJSON(@json);


DECLARE @idx INT = 1
DECLARE @JsonCount INT = (SELECT COUNT(*) FROM @jsonTable)

WHILE @idx <= @JsonCount
BEGIN
    DECLARE @SupportBankSettingID INT;
    DECLARE @InternalAuditID INT;
    DECLARE @PaymentTypeGatewaySettingID INT;
    DECLARE @BankID INT;
    SELECT @SupportBankSettingID = JSON_VALUE(@json, CONCAT('$[', @idx- 1, '].SupportBankSettingID')),
           @InternalAuditID = JSON_VALUE(@json, CONCAT('$[', @idx - 1, '].InternalAuditID')),
           @PaymentTypeGatewaySettingID = JSON_VALUE(@json, CONCAT('$[', @idx - 1, '].PaymentTypeGatewaySettingID')),
           @BankID = JSON_VALUE(@json, CONCAT('$[', @idx - 1, '].BankID'));

    IF NOT EXISTS (
        SELECT 1
        FROM PaymentTypeGatewaySupportBankSetting a
        WHERE a.PaymentTypeGatewaySettingID = @PaymentTypeGatewaySettingID
        AND a.BankID = @BankID
    )
    BEGIN
        INSERT INTO PaymentTypeGatewaySupportBankSetting (PaymentTypeGatewaySettingID, BankID)
        SELECT @PaymentTypeGatewaySettingID, @BankID
    END
    


    
    -- Increment the index
    SET @idx = @idx + 1
END